import React, { Component } from 'react';
import Piechart from './Piechart';
import './App.css';
class App extends Component {
  state = {
    dataset: [5,10,12,15,18],
  };
  render() {
// Destructuring is the process of getting things exactly by their name.
    const { dataset } = this.state;
    return (
      <div className="App">
        <PieChart dataset={dataset} />
      </div>
    );
  }
}
export default App;
